import React, { Component } from 'react';
import { Map, GoogleApiWrapper, Marker } from 'google-maps-react';
import taxi from './taxi.png';
import stop from './stop.jpg';

const mapStyles = {
    map: {
      position: 'absolute',
      width: '75%',
      height: '100%'
    }
  };
export class NewMap extends Component {
    state = {
        showingInfoWindow: false,
        activeMarker: {},
        selectedPlace: {}
    };
    
  render() {
    const style = Object.assign({}, mapStyles.map);
    const toCoordinates= this.props.toCoordinates;
    const fromCoordinates= this.props.fromCoordinates;
    return (
        <div style={style}>
      <Map
        google={this.props.google}
        zoom={14}
        
        initialCenter={
          {
            lat: fromCoordinates.lat || 59.33,
            lng: fromCoordinates.lng || 18.056
          }
        }
      ><Marker 
          lat={fromCoordinates.lat || 59.33}
          lng={fromCoordinates.lng || 18.056}
          icon={{
            url: taxi,
            scaledSize:  new this.props.google.maps.Size(50,50)
            }}
          
  /><Marker 
  lat={toCoordinates.lat || 59.33}
  lng={toCoordinates.lng || 18.056}
  icon={{
    url: stop,
    scaledSize:  new this.props.google.maps.Size(50,50)
    }}
  
/>
      </Map>
      </div>
    );
  }
}
export default GoogleApiWrapper(
  (props) => ({
    apiKey: props.apiKey
  }
))(NewMap)
